  state = {
    messageArr:[
      {id:'01',title:'消息1'},
      {id:'02',title:'消息2'},
      {id:'03',title:'消息3'},
      {id:'04',title:'消息5'},
    ]
  }
  render() {
    const {messageArr} =  this.state
    return (
      <div>
        <ul>
          {messageArr.map(item=>
              (
                <li key={item.id}>
                  <MyNavLink >message001</MyNavLink>&nbsp;&nbsp;
                </li>
              )
